import React from 'react';
import { Breadcrumbs, Link } from '@material-ui/core';
// import PropTypes from 'prop-types'
// import { Link } from "react-router-dom";

export const Header = (props) => {
    let mystyle = {
        display: 'flex',
        justifyContent: 'center',
    }
    function handleClick(event) {
        event.preventDefault();
        console.info('You clicked a breadcrumb.');
      }
    return (
        <>
            {/* <img src="../public/etarkimg.png" style={mystyle} alt="logo" /> */}
            <nav>
            <Breadcrumbs aria-label="breadcrumb" style={mystyle}>
                <Link color="inherit" href="/" onClick={handleClick} aria-current="page">
                    How to use
                </Link>
                <Link color="inherit" href="/getting-started/installation/" onClick={handleClick} aria-current="page">
                    About Us
                </Link>
                <Link
                    color="textPrimary"
                    href="/components/breadcrumbs/"
                    onClick={handleClick}
                    aria-current="page"
                >
                    Contact Us
                </Link>
            </Breadcrumbs>
            </nav>
        </>
    )
}
